import React from "react";
import axios from "axios"; 
import "./index.css";

const Modal = ({smsList}) => {
  console.log(smsList);
  const submitForm = (event) => {
    event.preventDefault();
  };

  addStudent = () =>{
    const {smsList} = this.state;
    const postResonse = axios
        .post("http://localhost:8080/api/students")
        .then((response)=>{
            console.log("post response",response);
        })
  }

  return (
    <div className="modal-outer-container">
      <div className="modal-container">
        <form className="sms-form" onSubmit={submitForm}>
          <input
            type="text"
            placeholder="Student name"
            className="studentName input"
            required
          />

          <input
            type="text"
            placeholder="Student Address"
            className="studentAddress input"
            required
          />

          <input
            type="email"
            placeholder="Student Email"
            className="studentEmail input"
            required
          />

          <button type="submit" className="btn-studentSubmit">
            submit
          </button>
        </form>
      </div>
    </div>
  );
};

export default Modal;
